<template>
  <div class="container">
    <div class="main">
      <div class="main-header" @click="$router.push('/')">INPFORSPHERE.COM</div>
      <div class="main-content">
        <div class="main-content_header">Регистрация документа</div>
        <div class="main-content__head">Придумайте пароль</div>
        <ui-input
          type="password"
          placeholder="Введите пароль"
          :value="form.password"
          :keyForm="'password'"
          @onChange="onChange"
        />
        <div class="main-content__head" style="margin-top: 10px">
          Повторите пароль
        </div>
        <ui-input
          type="password"
          placeholder="Введите пароль"
          :value="form.verifyPassword"
          :keyForm="'verifyPassword'"
          @onChange="onChange"
        />
        <ui-button
          :title="'SAVE'"
          :disabled="(validate.password && validate.verifyPassword) || loading"
          @action="action"
        />
        <div class="main-content__info">
          <svg
            width="20"
            height="20"
            viewBox="0 0 20 20"
            fill="none"
            xmlns="http://www.w3.org/2000/svg"
            xmlns:xlink="http://www.w3.org/1999/xlink"
          >
            <g opacity="0.5">
              <mask
                id="mask0_243_5286"
                style="mask-type: alpha"
                maskUnits="userSpaceOnUse"
                x="0"
                y="0"
                width="20"
                height="20"
              >
                <rect width="20" height="20" fill="url(#pattern0)" />
              </mask>
              <g mask="url(#mask0_243_5286)">
                <rect width="20" height="20" fill="#567BF3" />
              </g>
            </g>
            <defs>
              <pattern
                id="pattern0"
                patternContentUnits="objectBoundingBox"
                width="1"
                height="1"
              >
                <use
                  xlink:href="#image0_243_5286"
                  transform="scale(0.00195312)"
                />
              </pattern>
              <image
                id="image0_243_5286"
                width="512"
                height="512"
                xlink:href="data:image/png;base64,"
              />
            </defs>
          </svg>
          <span>
            Вся информация анонимна и конфиденциальна, поэтому Автор для входа
            использует только ссылку и пароль
          </span>
        </div>
        <div class="main-content__info" style="margin-top: 10px">
          <svg
            width="20"
            height="20"
            viewBox="0 0 20 20"
            fill="none"
            xmlns="http://www.w3.org/2000/svg"
            xmlns:xlink="http://www.w3.org/1999/xlink"
          >
            <g opacity="0.5">
              <mask
                id="mask0_243_5286"
                style="mask-type: alpha"
                maskUnits="userSpaceOnUse"
                x="0"
                y="0"
                width="20"
                height="20"
              >
                <rect width="20" height="20" fill="url(#pattern0)" />
              </mask>
              <g mask="url(#mask0_243_5286)">
                <rect width="20" height="20" fill="#567BF3" />
              </g>
            </g>
            <defs>
              <pattern
                id="pattern0"
                patternContentUnits="objectBoundingBox"
                width="1"
                height="1"
              >
                <use
                  xlink:href="#image0_243_5286"
                  transform="scale(0.00195312)"
                />
              </pattern>
              <image
                id="image0_243_5286"
                width="512"
                height="512"
                xlink:href="data:image/png;base64,"
              />
            </defs>
          </svg>
          <span>
            Если вы забыли пароль, восстановление доступа невозможно. Пароль знаете только вы. Сохраните его в надёжном месте
          </span>
        </div>
      </div>
    </div>
  </div>
</template>

<script>
import { mapMutations } from 'vuex'
export default {
  validate({ query }) {
    if (!query.link) {
      return false;
    }

    return true;
  },
  data() {
    return {
      form: {
        link: this.$route.query.link,
        password: "",
        verifyPassword: "",
      },
      validate: {
        password: false,
        verifyPassword: false,
      },
      loading: false
    };
  },
  methods: {
    ...mapMutations({
      setAuth: 'setAuth'
    }),
    onChange({ key, value, valide }) {
      this.form[key] = value;
      this.validate[key] = valide;
    },
    async action () {
      if (this.form.password !== this.form.verifyPassword) {
        this.$toast.error('Пароли не совпадают')
        return
      }

      if (this.loading) {
        this.$toast.warning('Идет загрузка')
      }

      this.loading = true

      try {
        await this.$axios.post('/document/signup', this.form)

        this.setAuth(true)

        this.$router.push({ path: '/document/verify', query: { ...this.$route.query, link: this.form.link } })
      } catch (error) {
        this.$toast.error(error?.response?.data?.message)
      } finally {
        this.loading = false
      }
    }
  },
};
</script>

